import React from 'react'
import Layout from '../Components/Layout/Layout'
import img4 from '../images/img3.jpg';
import { Box, Button } from '@mui/material';

function Home() {
  return (
    <>
    <Layout>
        <Box sx={{pt:1}}>
            <img src={img4} alt="img4" style={{width:'99%',marginLeft:'0.5%',height:'600px'}}/>
            <h1>Al-BAIK</h1>
            <p>Discover the best food</p>
            <Button variant='outlined'>Order now</Button>
        </Box>
    </Layout>
    </>
  )
}

export default Home
